import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [question, setQuestion] = useState(null);

  useEffect(() => {
    async function fetchData() {
      const response = await axios.get('/api/question/');
      setQuestion(response.data);
    }
    fetchData();
  }, []);

  return (
    <div>
      {question && (
        <div>
          <h2>{question.text}</h2>
          <p>{question.answer}</p>
        </div>
      )}
    </div>
  );
}

export default App;
